import React from 'react'
import {
  Card,
  CardBody,
  CardTitle,
  CardSubtitle,
  CardText,
  CardFooter,
  Button,
  Container,
} from "reactstrap";

function Course (){
   
    return (
      <Card>
        <CardBody  className="text-center">
        <CardSubtitle className="fw-bold">Java Course</CardSubtitle>
        <CardText >
          This is Java course for students with all the fundamental concepts
        </CardText>
        <Container className="text-center">
          <Button color='danger'>Delete</Button>
          <Button color="primary">Update</Button>
        </Container>
        </CardBody>
      </Card>
    );
}

export default Course;
